import React from "react";

class OverlayFlightForm extends React.Component {
    constructor(props) { 
        super(props);
    }

    render() {
        return (
            <button aria-label="Close Account Info Modal Box">&times;</button>
            );
    }
}

export default OverlayFlightForm;
